import { IconButton } from "@mui/material";
import axios from "axios";
import { useState } from "react";
import ThumbUpIcon from "@mui/icons-material/ThumbUp";

export const LikeOn = ({ params, likeStyle, unLikeStyle, isLike, }) => {
  const [like, setLike] = useState(isLike);

  const handleLike = () => {
    setLike(true);
    axios
      .put(`http://localhost:3001/api/nft/like/${params}`, { like: true })
      .then((res) => {
        console.log(res);
      })
      .catch((err) => {
        console.log(err);
      });
  };
  const handleUnike = () => {
    setLike(false);
    axios
      .put(`http://localhost:3001/api/nft/like/${params}`, { like: false })
      .then((res) => {
        console.log(res);
      })
      .catch((err) => {
        console.log(err);
      });
  };

  if (like === false) {
    return (
      <IconButton style={likeStyle} onClick={handleLike}>
        <ThumbUpIcon />
      </IconButton>
    );
  } else if(like === true) {
    return (
      <IconButton style={unLikeStyle} onClick={handleUnike}>
        <ThumbUpIcon />
      </IconButton>
    );
  }

  return null
};
